import React from 'react';
import { Button } from 'react-bootstrap';
const List = ({people}) => {
    return (
        <React.Fragment>
            {people.map((person) => {
                    const {id, name, age, image} = person;
                        return (
                            <article key={id} className="person">
                                <img src={image} alt={name} />
                                <div>
                                    <h4>{name}</h4>
                                    <p>{age} years</p>   
                                </div> 
                            </article>
                        );
                })
            }
        </React.Fragment>

    );
};

export default List;
